function Healthbar (health: Sprite, num: number, num2: number) {
    percent = Math.constrain(num2 / num, 0, 1)
    healthBarImage = health.image
    healthBarImage.fillRect(1, 1, health.width, 4, 2)
    healthBarImage.fillRect(1, 1, health.width * percent, 4, 7)
    healthBarImage.drawRect(0, 0, health.width, health.height, 12)
}
